import React from 'react';
import ModalKa from './Modal';
import { useHistory } from 'react-router-dom';

export default function Home(props) {
  const history = useHistory();
  if (!props.state.statusSession) {
    history.push('/login');
  }
  return (
    <>
      <div className='div-table'>
        <table className='w-75 container table table-striped table-dark'>
          <tbody>
            {props.questions.map((item) => {
              return (
                <tr>
                  <th scope='row' key={item._id}>
                    {item.theme}
                  </th>
                  {item.questions.map((question, index) => {
                    return (
                      <>
                        <td key={item._id + index}>
                          <ModalKa question={question} />
                        </td>
                      </>
                    );
                  })}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </>
  );
}
